import React from "react";
import { useSelector } from "react-redux";

const CommentList = () => {
  const comments = useSelector((state) => state.comments);
  return (
    <div data-testid="commentList">
      {comments?.map((item) => (
        <div key={item}>{item}</div>
      ))}
    </div>
  );
};

export default CommentList;
